/* --------------------------------------------------------------------------------------------- */
/* Unit tests the AESGCM external interface.                                                     */
/* --------------------------------------------------------------------------------------------- */
void SSFAESGCMUnitTest(void)
{
    uint8_t pt[100];
    uint8_t ct[100];
    uint8_t tag[100];
    uint32_t i, j;

    SSF_ASSERT_TEST(SSFAESGCMEncrypt(_AESGCMUT[0].pt, _AESGCMUT[0].ptLen, NULL,
                                     _AESGCMUT[0].ivLen, _AESGCMUT[0].auth, _AESGCMUT[0].authLen,
                                     _AESGCMUT[0].key, _AESGCMUT[0].keyLen, tag, 
                                     _AESGCMUT[0].tagLen, ct, _AESGCMUT[0].ctLen));
    SSF_ASSERT_TEST(SSFAESGCMEncrypt(_AESGCMUT[0].pt, _AESGCMUT[0].ptLen, _AESGCMUT[0].iv,
                                     _AESGCMUT[0].ivLen, _AESGCMUT[0].auth, _AESGCMUT[0].authLen,
                                     NULL, _AESGCMUT[0].keyLen, tag, _AESGCMUT[0].tagLen,
                                     ct, _AESGCMUT[0].ctLen));
    SSF_ASSERT_TEST(SSFAESGCMEncrypt(_AESGCMUT[0].pt, _AESGCMUT[0].ptLen, _AESGCMUT[0].iv,
                                     _AESGCMUT[0].ivLen, _AESGCMUT[0].auth, _AESGCMUT[0].authLen,
                                     _AESGCMUT[0].key, _AESGCMUT[0].keyLen, NULL, 
                                     _AESGCMUT[0].tagLen, ct, _AESGCMUT[0].ctLen));

    SSF_ASSERT_TEST(SSFAESGCMDecrypt(_AESGCMUT[0].ct, _AESGCMUT[0].ctLen, NULL, _AESGCMUT[0].ivLen,
                                     _AESGCMUT[0].auth, _AESGCMUT[0].authLen, _AESGCMUT[0].key,
                                     _AESGCMUT[0].keyLen, _AESGCMUT[0].tag, _AESGCMUT[0].tagLen, pt,
                                     _AESGCMUT[0].ptLen));
    SSF_ASSERT_TEST(SSFAESGCMDecrypt(_AESGCMUT[0].ct, _AESGCMUT[0].ctLen, _AESGCMUT[0].iv,
                                     _AESGCMUT[0].ivLen, _AESGCMUT[0].auth, _AESGCMUT[0].authLen,
                                     NULL, _AESGCMUT[0].keyLen, _AESGCMUT[0].tag,
                                     _AESGCMUT[0].tagLen, pt, _AESGCMUT[0].ptLen));
    SSF_ASSERT_TEST(SSFAESGCMDecrypt(_AESGCMUT[0].ct, _AESGCMUT[0].ctLen, _AESGCMUT[0].iv,
                                     _AESGCMUT[0].ivLen, _AESGCMUT[0].auth, _AESGCMUT[0].authLen,
                                     _AESGCMUT[0].key, _AESGCMUT[0].keyLen, NULL,
                                     _AESGCMUT[0].tagLen, pt, _AESGCMUT[0].ptLen));

    for (j = 0; j < 10; j++)
    {
        for (i = 7; i < sizeof(_AESGCMUT) / sizeof(SSFAESGCMUT_t); i++)
        {
            memset(pt, 0, sizeof(pt));
            memset(ct, 0, sizeof(ct));
            memset(tag, 0, sizeof(tag));

            if (_AESGCMUT[i].pf == 0)
            {
                SSFAESGCMEncrypt(_AESGCMUT[i].pt, _AESGCMUT[i].ptLen, _AESGCMUT[i].iv,
                                 _AESGCMUT[i].ivLen, _AESGCMUT[i].auth, _AESGCMUT[i].authLen,
                                 _AESGCMUT[i].key, _AESGCMUT[i].keyLen, tag, _AESGCMUT[i].tagLen,
                                 ct, _AESGCMUT[i].ctLen);

                SSF_ASSERT(memcmp(tag, _AESGCMUT[i].tag, _AESGCMUT[i].tagLen) == 0);
                SSF_ASSERT(memcmp(ct, _AESGCMUT[i].ct, _AESGCMUT[i].ctLen) == 0);
            }

            bool pf = SSFAESGCMDecrypt(_AESGCMUT[i].ct, _AESGCMUT[i].ctLen, _AESGCMUT[i].iv, 
                                       _AESGCMUT[i].ivLen, _AESGCMUT[i].auth, 
                                       _AESGCMUT[i].authLen, _AESGCMUT[i].key, 
                                       _AESGCMUT[i].keyLen, _AESGCMUT[i].tag,
                                       _AESGCMUT[i].tagLen, pt, _AESGCMUT[i].ptLen);

            SSF_ASSERT((pf != 0) == (_AESGCMUT[i].pf != 0));
            SSF_ASSERT((_AESGCMUT[i].pf != 0) 
                       || (memcmp(pt, _AESGCMUT[i].pt, _AESGCMUT[i].ptLen) == 0));
        }
    }
}

#endif /* SSF_CONFIG_AESGCM_UNIT_TEST */
